import { Component } from '@angular/core';

@Component({
  selector: 'app-toolbar',
  templateUrl: './toolbar.component.html',
  styleUrls: ['./toolbar.component.scss']
})
export class ToolbarComponent {
  title = 'Variação do Ativo';
}
<mat-toolbar>
  <span>{{ title }}</span>
</mat-toolbar>
